puter when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\n    <ul class=\"disc\">\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n','2014-06-13 22:03:36','2014-06-13 22:03:36',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Privacy Policy','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','<p style=\"color: #ff0000; font-weight: bold; font-size: 13px\">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path=\"general/store_information/name\"}} uses and protects any information\n    that you give {{config path=\"general/store_information/name\"}} when you use this website.\n    {{config path=\"general/store_information/name\"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path=\"general/store_information/name\"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path=\"trans_email/ident_general/email\"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path=\"general/store_information/address\"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class=\"data-table\">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>','2014-06-13 22:03:36','2014-06-13 22:03:36',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'opportunity overview','single_page',NULL,NULL,'opportunity-overview',NULL,'<div class=\"main-banner-holder\"><img src=\"{{media url=\"wysiwyg/opportunity-header-2.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"container clearfix separator-shadow\">\r\n<div class=\"content\" style=\"width: 450px; float: left; padding: 0px 30px 30px 0;\"><iframe src=\"//www.youtube.com/embed/DRAjkPYfpXE?rel=0\" frameborder=\"0\" width=\"450\" height=\"253\"></iframe></div>\r\n<h1><strong>OPPORTUNITY OVERVIEW</strong></h1>\r\n<p>Your health, your time, your freedom, and the opportunity to change your life, is all in your hands with Healthy Habits Global.</p>\r\n<p>Healthy Habits believes that empowering people like you can bring happiness and security into your life. Whether you\'re ready to make a small change to improve your circumstances, improve the health of your loved ones, or significantly transform your life, Healthy Habits is the opportunity to make your mark in the explosive health and wellness industry you\'ve been looking for.</p>\r\n<p>As a Healthy Habits Distributor you will have the ability to build your business seamlessly in every country we do business in.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"font-size: 1.2em;\"><strong>You will enjoy the opportunity to earn from 7 different income streams.</strong></p>\r\n<ul>\r\n<li>Personal Retail Customers</li>\r\n<li>Preferred Customer Commissions</li>\r\n<li>Daily Fast Start Bonuses</li>\r\n<li>Team Commissions</li>\r\n<li>Awards Program</li>\r\n<li>2% Infinity Bonus</li>\r\n<li>Prosperity Bonus</li>\r\n<li>Luxury Car Bonus</li>\r\n<li>3% Global Bonus Pool</li>\r\n</ul>\r\n<br />\r\n<div class=\"separator-shadow\">&nbsp;</div>\r\n<div>\r\n<h2>1. Personal Retail Customers</h2>\r\n<p>As a Distributor, you will have the ability to purchase Healthy Habits products at wholesale and sell them at the retail price. This is a great way for our Distributors to put instant cash in their pockets. Healthy Habits will have a complete program and training for individuals who love to do tradeshows and other events.</p>\r\n<h2>2. Preferred Customer Commission</h2>\r\n<p>HHG\'s #1 goal is to build a massive base of customers who are simply enjoying the benefits of our products. The founders know that in order to do this we must have a one of a kind compensation plan the rewards those distributors who build this base. This is what we are going to do for you!</p>\r\n<p><strong>HHG is going to pay you 20% on all your personal customer orders forever! The most exciting aspect is that you will not only receive the 20% on your personal customers but any customers that were placed frontline to you!</strong></p>\r\n<h2>3. Daily Fast Start Bonus</h2>\r\n<p>Healthy Habits Distributors will have the ability to earn up to 50% in bonuses on their personal organization through 4 generations. <strong>However, we are raising the bar in the direct sales industry by not only paying Fast Start Bonuses on the distributors than come into you organization but all your customers as well.</strong></p>\r\n<h3 style=\"color: #a27e4f;\">FAST START BONUS EXAMPLE</h3>\r\n<p>The following example is for illustrative purposes only. Your results will vary.</p>\r\n<p>Let\'s assume that you enroll 4 like-minded distributors into your HHG business that do the same. Everybody duplicates what you did, enrolling 4 distributors and that duplicated through 4 levels.</p>\r\n<p>Let\'s assume everyone enrolled with the $499 Success Pack.</p>\r\n<p>With the power of duplication, your potential fast start bonus income could look like this:</p>\r\n<div class=\"styled_table table_blue\">\r\n<table>\r\n<thead>\r\n<tr><th style=\"width: 25%;\">Level</th><th style=\"width: 25%;\"># of Distributors</th><th style=\"width: 25%;\">Percent Commission</th><th style=\"width: 25%;\">Monthly Commission</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>1</td>\r\n<td>4</td>\r\n<td>25%</td>\r\n<td>$499</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td>2</td>\r\n<td>16</td>\r\n<td>10%</td>\r\n<td>$798</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>64</td>\r\n<td>10%</td>\r\n<td>$3,193</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td>4</td>\r\n<td>256</td>\r\n<td>5%</td>\r\n<td>$6,387</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>TOTAL -&gt;</td>\r\n<td>$10,877</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong>What if you did this in a week, how about a month, or even a year!</strong></p>\r\n<h2>4. Monthly Residual Overrides</h2>\r\n<p>For long term financial freedom, the most exciting part of the Healthy Habits Opportunity is the ability to earn additional monthly residual income from the sale of HHG products! You will receive commissions every month from the sales volume in your organization. The higher your rank the more levels you earn&hellip;maybe even through Infinity! Below is a hypothetical example.</p>\r\n<p><strong>MONTHLY OVERRIDE EXAMPLE</strong></p>\r\n<p>The following example is for illustrative purposes only. Your results will vary.</p>\r\n<p>Let\'s assume that you enroll 4 like-minded distributors into your HHG business that do the same. Everybody duplicates what you did, enrolling 4 distributors and that duplicated through 7 levels.</p>\r\n<p>Let\'s assume everyone was qualified with 100 PV (personals sales volume)</p>\r\n<p>With the power of duplication, your potential monthly residual income could look like this:</p>\r\n<div class=\"styled_table table_blue\">\r\n<table style=\"width: 466px;\" dir=\"ltr\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<thead>\r\n<tr><th style=\"width: 25%;\">Level</th><th style=\"width: 25%;\"># of Distributors</th><th>&nbsp;</th><th style=\"width: 25%;\">Percent Commission</th><th style=\"width: 25%;\">Monthly Commission</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr class=\"odd\">\r\n<td bgcolor=\"#ffffff\" width=\"36\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">You</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\" width=\"36\">1</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">4</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">5%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$20</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td bgcolor=\"#ffffff\" width=\"36\">2</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">16</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">5%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$80</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\" width=\"36\">3</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">64</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">10%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$640</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td bgcolor=\"#ffffff\" width=\"36\">4</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">256</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">5%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$1,280</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\" width=\"36\">5</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">1024</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">5%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$5,120</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td bgcolor=\"#ffffff\" width=\"36\">6</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">4096</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">6%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$24,576</td>\r\n</tr>\r\n<tr>\r\n<td bgcolor=\"#ffffff\" width=\"36\">7</td>\r\n<td bgcolor=\"#ffffff\" width=\"112\">16,384</td>\r\n<td bgcolor=\"#ffffff\" width=\"2\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\" width=\"136\">7%</td>\r\n<td bgcolor=\"#ffffff\" width=\"140\">$114,688</td>\r\n</tr>\r\n<tr class=\"odd\">\r\n<td bgcolor=\"#ffffff\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\">&nbsp;</td>\r\n<td bgcolor=\"#ffffff\"><strong>TOTAL -&gt;</strong></td>\r\n<td bgcolor=\"#ffffff\"><strong> $146,404</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>This is obviously a hypothetical example in a perfect world. HHG does not guarantee or make any income claims.</p>\r\n<p>10% right would = over $14,000 monthly that\'s over 175k a year<!--However, let\'s say you were only 10% as successful as this example. That\'s still over $16,790 per month… that\'s $201,489 per year!--></p>\r\n<p>With products as unique and as powerful as HHG products are, the sky is the limit, but you must become an HHG Distributor first! ENROLL NOW!</p>\r\n<h2>5. Infinity Bonus</h2>\r\n<p>HHG Distributors who decide they truly want to build an income that could provide them the financial freedom they\'ve been looking for, we will pay a 2% Infinity Bonus on all your sales volume below your 8th level. This bonus is paid to HHG Diamonds and above.</p>\r\n<p>If you look at the hypothetical example above and just duplicate it down a few more levels&hellip;can you image the potential income from this bonus!</p>\r\n<h2>6. Luxury Car Bonus</h2>\r\n<p>The Founders of HHG now how important it is to reward the distributors who are actively building their business. HHG has put in place a unique <a style=\"outline: none;\" title=\"Luxury Car Club\" href=\"../../docwhite8ad8.html?toDo=luxury-car-club\">Luxury Car Bonus</a> that rewards distributors at the lower ranks of the compensation plan not just the top earners.</p>\r\n<p>What kind of car would you get if you had this extra income?</p>\r\n<table style=\"width: 80%;\">\r\n<tbody>\r\n<tr>\r\n<td width=\"146\">Gold</td>\r\n<td width=\"101\">$200 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Emerald</td>\r\n<td>$400 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Ruby</td>\r\n<td>$600 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Diamond</td>\r\n<td>$800 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Blue Diamond</td>\r\n<td>$1,000 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Black Diamond</td>\r\n<td>$1,200 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Crown Diamond</td>\r\n<td>$1,400 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Triple Crown Diamond position</td>\r\n<td>$1,800 /m</td>\r\n</tr>\r\n<tr>\r\n<td>Triple Crown Prosperity</td>\r\n<td>$1,000,000</td>\r\n</tr>\r\n<tr>\r\n<td>3% Global Bonus Pool</td>\r\n<td>\r\n<p>HHG distributors that hit the rank of Black Diamond and above get to partake and capitalize on the company&rsquo;s total gross sales volume (gross cv)</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Please review the HHG Compensation plan for all the details on how to achieve and maintain these ranks.</p>\r\n<h2>7. Prosperity Bonus</h2>\r\n<p>Hold on&hellip;are these bonuses real? Yes they are! HHG is offering you the opportunity to earn life changing bonuses. If you are the type of person who loves to be rewarded for your effort, than check out the amount of our Prosperity Bonuses below.</p>\r\n<table style=\"width: 259px;\">\r\n<tbody>\r\n<tr>\r\n<td width=\"146\">Bronze</td>\r\n<td width=\"101\">$250</td>\r\n</tr>\r\n<tr>\r\n<td>Silver</td>\r\n<td>$500</td>\r\n</tr>\r\n<tr>\r\n<td>Gold</td>\r\n<td>$1,000</td>\r\n</tr>\r\n<tr>\r\n<td>Emerald</td>\r\n<td>$2,500</td>\r\n</tr>\r\n<tr>\r\n<td>Ruby</td>\r\n<td>$5,000</td>\r\n</tr>\r\n<tr>\r\n<td>Diamond</td>\r\n<td>$10,000</td>\r\n</tr>\r\n<tr>\r\n<td>Blue Diamond</td>\r\n<td>$100,000*</td>\r\n</tr>\r\n<tr>\r\n<td>Black Diamond</td>\r\n<td>$250,000*</td>\r\n</tr>\r\n<tr>\r\n<td>Crown Diamond</td>\r\n<td>$400,000*</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>*</strong>Blue, Black and Crown Diamond Bonuses are paid evenly over 12-24 months.</p>\r\n<p><strong>For more details please click and review our <a style=\"outline: none;\" title=\"Compensation\" href=\"../../docwhite58e3.html?toDo=compensation-summary\">Compensation Plan Summary</a>.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>*The above illustrations are only for educational purposes and is not intended to serve as a guarantee of income. Success in this business requires hard work, dedication and good sales skills. The average participant in this business earns between $500 and $2,000. Some earn less while some earn much more.</p>\r\n</div>\r\n</div>','2014-09-01 21:54:38','2014-09-08 19:53:40',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Resumen de compensación','single_page',NULL,NULL,'resumen-de-compesacion',NULL,'<div class=\"main-banner-holder \"><img title=\"Compensacion \" src=\"{{media url=\"wysiwyg/paginas/compensation-header.jpg\"}}\" alt=\"\" /></div>\r\n<div class=\"container separator-shadow clearfix\">\r\n<div class=\"content\">\r\n<div id=\"middle\" class=\"full_width\">\r\n<div class=\"container clearfix\" style=\"text-align: justify; text-justify: inter-word;\"><iframe style=\"height: 825px; width: 1000px; border: 0;\" src=\"//docs.google.com/viewer2ba7.html?url=http://www.expertoconsultor.com/cafehealth/hhg1page.pdf&amp;embedded=true\" frameborder=\"0\" width=\"1000\" height=\"825\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>','2014-09-03 22:23:08','2014-09-08 19:54:53',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Club de autos de lujo','single_page',NULL,NULL,'club-autos-lujo',NULL,'<div class=\"main-banner-holder \"><img title=\"Auto de lujo\" src=\"{{media url=\"wysiwyg/paginas/car-club-header-2.jpg\"}}\" alt=\"Auto de lujo\" /></div>\r\n<div class=\"container separator-shadow clearfix\">\r\n<div class=\"content sidebar\">\r\n<div class=\"main-content\">\r\n<h2><strong>LUXURY CAR CLUB</strong></h2>\r\n<div id=\"g1-divider-counter-1\" class=\"g1-divider g1-type-simple\">&nbsp;</div>\r\n<p>The Founders of HHG know how important it is to reward the distributors who are actively building their business. HHG has put in place a unique Luxury Car Bonus that rewards distributors at the lower ranks of the compensation plan not just the top earners.</p>\r\n<p>What kind of car would you get if you had this extra income?</p>\r\n<p>Gold $200 /m<br /> Emerald $400 /m<br /> Ruby $600 /m<br /> Diamond $800 /m<br /> Blue Diamond $1,000 /m<br /> Black Diamond $1,200 /m<br /> Crown Diamond $1,400 /m</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"sidebar\">{{widget type=\"cms/widget_block\" template=\"cms/widget/static_block/default.phtml\" block_id=\"7\"}} </div>\r\n</div>\r\n</div>','2014-09-03 23:29:14','2014-09-08 20:00:42',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Descripcion del producto','single_page',NULL,NULL,'descripcion-producto',NULL,'<div class=\"main-banner-holder\"><img title=\"Todos los productos\" src=\"{{media url=\"wysiwyg/paginas/combined-all-products.jpg\"}}\" alt=\"Todos los productos\" /></div>\r\n<div class=\"container separator-shadow\">\r\n<div class=\"content\">\r\n<h1><strong>PRODUCT OVERVIEW</strong></h1>\r\n<p>The Founders of Healthy Habits Global have a vision of taking the everyday unhealthy habits such as drinking coffee and turning them into healthy habits. What better way of doing that than through the most consumed beverage in the world next to water&hellip;.. COFFEE!</p>\r\n<p>Healthy Habits coffee is enriched with TAGG (Organic Tongkat-Ali Extract, Organic Ginseng Extract and Organic Ganoderma Lucidum Extract). Ganoderma Lucidum is often referred to as the \"King Of Herbs\" and is one of the most versatile all natural herbs on the planet. With the addition of Tongkat-Ali and Ginseng, Healthy Habits has supercharged the raw power delivering 154 Antioxidants and over 200 phytonutrients that promote the body\'s ability to function in an optimal state in a single serving.</p>\r\n<p>Our exclusive proprietary blends and flavors will tempt your senses while providing many of the nutrients you need to get through your busy day. Healthy Habits enriched coffee line consists of Gourmet Black, Gourmet Blend, Gourmet Cappuccino, Gourmet Chai tea and Gourmet Hot Cocoa. We encourage you to try one of our flavors!</p>\r\n<p>The distinctive asset of our coffee line is that they are available to you anytime, anywhere, through our unique delivery system&hellip; single serve packets. You can put them in your pocket, purse, gym bag or even take them on a plane. You will never be without your&nbsp;<strong>Healthy Habits Coffee</strong>&nbsp;no matter where you are.</p>\r\n<p>Healthy Habits has spared no expense in the development and manufacturing of our product line. Our manufacturing facility meets and exceeds the highest standards in quality assurance and you can rest easy knowing we take great pride in the safety and quality of our products.</p>\r\n<p><strong><strong>Here are just a few our manufacturing certifications.</strong></strong></p>\r\n<p><strong><strong><img title=\"certificaciones\" src=\"{{media url=\"wysiwyg/paginas/certifications.jpg\"}}\" alt=\"certificaciones\" /></strong></strong></p>\r\n<p><strong><strong><br /></strong></strong></p>\r\n{{widget type=\"catalog/product_widget_new\" display_type=\"all_products\" products_count=\"10\" template=\"catalog/product/widget/new/content/category_view.phtml\"}} &nbsp;</div>\r\n</div>','2014-09-04 00:03:01','2014-09-09 23:54:43',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'La ciencia','single_page',NULL,NULL,'la-ciencia',NULL,'<div class=\"main-banner-holder\"><img title=\"ciencia\" src=\"{{media url=\"wysiwyg/paginas/science-header.jpg\"}}\" alt=\"ciencia\" /></div>\r\n<div class=\"container separator-shadow\">\r\n<div class=\"content\">\r\n<h1 style=\"text-align: center;\"><strong>The 5 Main Components of<br /><span style=\"font-size: xx-large;\">Ganoderma</span></strong></h1>\r\n<div class=\"row clearfix\">\r\n<div class=\"col col_1_3 alpha\">\r\n<div class=\"inner\">\r\n<h3><strong>1. Polysaccharide</strong></h3>\r\n<p>The amazing nutrientes that are known to help strengthen cell membranes, boost anti-oxidant levels, and cleanse toxins from the body. Polysaccharides also moderate cholesterol and blood sugar levels, regulates digestive healthy and aids in the prevention of degenerative diseases.</p>\r\n</div>\r\n</div>\r\n<div class=\"col col_1_3 \">\r\n<div class=\"inner\"><img title=\"Ganoderma\" src=\"{{media url=\"wysiwyg/paginas/ciencia/ganoderma-2.jpg\"}}\" alt=\"Ganoderma\" width=\"100%\" /></div>\r\n</div>\r\n<div class=\"col col_1_3  omega\">\r\n<div class=\"inner\">\r\n<h3><strong>2. Ganoderic Essence</strong></h3>\r\n<p>The \"Rejuvenator\" as it assists in the detoxification and nourishment of the skin, the largest organ and \"protector of body\". Helps prevent cellular damage from free radicals while boosting the natural nourishment of the skin. Studies have shown that Ganoderma extract helps in the recovery of certain skin diseases.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">&nbsp;</div>\r\n<div class=\"row clearfix\">\r\n<div class=\"col col_1_3 alpha\">\r\n<div class=\"inner\">\r\n<h3><strong>3. Triterpenoid</strong></h3>\r\n<p>Known as Ganoderma\'s cholesterol-busting super adaptogens! Found to be the most important active substances in Ganoderma with Anti-fungal, Anti-bacterial, Anti- viral and Anti- inflammatory properties.</p>\r\n</div>\r\n</div>\r\n<div class=\"col col_1_3 \">\r\n<div class=\"inner\">\r\n<h3><strong>4. Adenosine</strong></h3>\r\n<p>Referred to as the \"Building Block of Life\". These Properties have been found to improve the functions of the adrenal glands cortex to maintain hormonal balance. Found to help regulate and balance the metabolic rate, increasing energy. Found to assist in the suppression of blood clots, improving blood circulation. Also supports liver function.</p>\r\n</div>\r\n</div>\r\n<div class=\"col col_1_3  omega\">\r\n<div class=\"inner\">\r\n<h3><strong>5. Organic Germanium</strong></h3>\r\n<p>Germanium\'s powerful potential healing capabilities are centered on three major changes it makes in your body\'s overall balance. Research suggests that Germanium is shown to discharge abnormal electrical impulses around cell abscesses, enhance your body\'s overall \"effective\" oxygen levels, and regulate your body\'s complete electrical system.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">&nbsp;</div>\r\n<div class=\"row clearfix\">\r\n<div style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Beneficios del cafe con ganoderma\" src=\"{{media url=\"wysiwyg/paginas/ciencia/ganoderma-beneficios-2.jpg\"}}\" alt=\"Beneficios del cafe con ganoderma\" usemap=\"#Map\" />&nbsp;<map name=\"Map\"></map><br /><a href=\"http://www.habitossaludables.com.mx/www.ncbi.nlm.nih.gov/pubmed/indexa357.html?term=ganoderma+lucidum%2Freishi+mushroom\" target=\"_blank\">http://www.ncbi.nlm.nih.gov/pubmed/?term=ganoderma+lucidum%2Freishi+mushroom</a><a href=\"http://www.habitossaludables.com.mx/ganodermapdf200f.html?iframe=true&amp;width=1000&amp;height=825\" rel=\"prettyPhoto[iframes]\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Ganoderma en cafe\" src=\"{{media url=\"wysiwyg/paginas/ciencia/ganoderma-pdf-2.jpg\"}}\" alt=\"Ganoderma en cafe\" /></a></div>\r\n</div>\r\n<div class=\"row clearfix\">\r\n<h1><strong><span>Ginseng</span></strong></h1>\r\n<img style=\"float: right;\" title=\"Cafe de ginseng\" src=\"{{media url=\"wysiwyg/paginas/ciencia/ginseng-2.jpg\"}}\" alt=\"Cafe de ginseng\" />\r\n<p>For more than 2,000 years, the roots of Panax plants have been valued in Chinese herbalism for their invigorating, adaptogenic, and tonic properties. The term \"adaptogen\" connotes an agent that purportedly \"increases resistance to physical, chemical, and biological stress and builds up general vitality, including the physical and mental capacity for daily life. As a result of its long history of use, Panax Ginseng has been studied extensively by modern scientists and it has been found to possess hundreds of compounds, including ginsenosides, phenolics, and saccharides that contribute to its biological activity.</p>\r\n<p>The main active components of Panax ginseng are ginsenosides, which have been shown to have a variety of beneficial effects, including antioxidant and anti-inflammatory effects. Results of clinical research studies demonstrate that Panax ginseng may improve psychological function, immune function, and conditions associated with diabetes. Panax ginseng is also commonly used to slow the aging process, enhance memory, boost stamina, stimulate the immune system and improve athletic performance.</p>\r\n<p><strong>Healthy Habits</strong>&nbsp;utilizes the most advanced innovative processes to extract the purest form of Panax ginseng. Healthy Habits products are the pure, refined blend of Chinese Panax Ginseng extract in the liquid form. The properties allow the blending and mixing process to give it the effects in aroma and efficiency in use.</p>\r\n<br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Beneficios del cafe con ginseng\" src=\"{{media url=\"wysiwyg/paginas/ciencia/ginseng-panax-2.jpg\"}}\" alt=\"Beneficios del cafe con ginseng\" /></div>\r\n<div class=\"row clearfix\">\r\n<h1><strong><span>Tongkat Ali</span></strong></h1>\r\n<img style=\"float: right;\" title=\"Cafe con tongkat ali\" src=\"{{media url=\"wysiwyg/paginas/ciencia/tongkat-ali-img-2.jpg\"}}\" alt=\"Cafe con tongkat ali\" />\r\n<p>Tongkat Ali is an all-natural herb that helps increase testosterone in your blood. This herb is NOT a testosterone replacement, nor does is directly increase testosterone. Instead it triggers your body\'s ability to produce testosterone, combating the negative health risk revolved around Low Testosterone (low T) in both men and women.</p>\r\n<p>Research suggests that low levels of testosterone may increase the risk for cardiovascular disease, obesity, stroke, type 2 diabetes, metabolic syndrome, osteoporosis, depression and Alzheimer\'s disease. Low testosterone can also trigger fatigue, low libido, erectile dysfunction, enlarged prostate, muscular weakness, poor endurance, irritability, poor concentration and poor memory.</p>\r\n<p><strong>Healthy Habits</strong>&nbsp;utilizes the most advanced innovative processes to extract the purest form of Tongkat Ali. Healthy Habits products are the pure, refined Tongkat- Ali extract in the liquid form. The properties allow the blending and mixing process to give it the effects in aroma and efficiency in use.</p>\r\n<p>&nbsp;</p>\r\n<h3>Role of Testosterone in Women:</h3>\r\n<div class=\"list_check\">\r\n<ul>\r\n<li><strong>Keep bones healthy</strong>. The correct balance of testosterone furthers and supports the growth and strength of healthy bones, while too much or too little can harm bones.</li>\r\n<li><strong>Preserve cognitive health</strong>. Changes in cognition and cognitive fatigue may be related to changing hormone levels. Correcting testosterone levels might help prevent cognitive fatigue, according to research in Gynecological Endocrinology.</li>\r\n<li><strong>Maintain sex drive</strong>. After menopause, women might experience a dip in their sex drive. This low sex drive could be the result of lowering testosterone levels.</li>\r\n<li><strong>Manage pain levels</strong>. According to research in the journal Pain, women who take birth control pills and who have levels of testosterone that are out of balance with levels of estrogen might have less ability to manage their pain response.</li>\r\n</ul>\r\n</div>\r\n<br /><img title=\"Cafe con tongkat ali\" src=\"http://www.habitossaludables.com.mx/images/tongkat.jpg\" alt=\"Cafe con tongkat ali\" /></div>\r\n&nbsp;</div>\r\n</div>','2014-09-04 00:27:11','2014-09-10 18:24:48',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Acerca de la compañia','one_column',NULL,NULL,'acerca-de-la-compania',NULL,'<div class=\"separator-shadow\">&nbsp;</div>\r\n<h1><strong>ABOUT HEALTHY HABITS</strong></h1>\r\n<div class=\"entry-content\">\r\n<p><strong>Healthy Habits was founded on four core principles:</strong></p>\r\n<ul>\r\n<li>Create a company that thinks of our distributors and customers first</li>\r\n<li>Create strong but humble leadership</li>\r\n<li>Create an environment where people can win at every level</li>\r\n<li>Create the highest quality nutritional products in each category we enter</li>\r\n</ul>\r\n<p>At Healthy Habits every corporate and executive decision is accountable to these four principles.</p>\r\n<h3>Mission</h3>\r\n<p>Our mission is to create an opportunity where people from all walks of life can participate and create an immediate income as well as a long term monthly residual income. We will always offer unique health and wellness products that meet or exceed industry standards for quality assurance. We will always base corporate and executive decisions that air on the side of our distributors and customers.</p>\r\n<h3>Purpose</h3>\r\n<p>To develop life-long relationships with our customers and distributors based on the exceptional value of our products and personal attention they receive. We are committed to the financial stability and future of our consultants by consciously offering products of exceptional value. We are also committed to offering a compensation plan that will enhance an individual\'s ability to earn a reasonable part time income as well as the ability to achieve financial independence with a full time effort.</p>\r\n<h3>Leadership</h3>\r\n<p>Our management team has over 60 years of combined experience in the direct marketing industry and all have successfully earned millions of dollars as distributors. Although they all had achieved great personal success with good companies and good products, they still felt something was missing. They were constantly confronted with the question; why do some people have success and others do not. It was their desire and commitment to answer this question that put them on a mission to build Healthy Habits, a company that would truly help people succeed at every level.</p>\r\n<h3>Strength</h3>\r\n<p>We have aligned ourselves with consultants, advisors, and financial experts that have worked with some of the top companies in the industry. Our vendors are considered to be in the upper echelon in the fields of product manufacturing, internet technology, and International Business Management Healthy Habits management team is comprised of individuals and companies that will put us on track to reach our goal of becoming a billion dollar company in our first 6 years.</p>\r\n<div id=\"g1-divider-counter-2\" class=\"g1-divider g1-type-simple\">&nbsp;</div>\r\n<h2>&nbsp;</h2>\r\n<h2>Executive Team</h2>\r\n<h3><span>Ted FitzGerald</span>&nbsp;&ndash; Founder &ndash; Chief Executive Officer</h3>\r\n<p>Ted has been in the direct sales industry for over 17 years and brings a vast amount of business experience to HHG. Prior to his direct sales career, Ted built many businesses from the ground up including athletic clubs, restaurants and other retail establishments. His knowledge in finance, marketing, and operations will help take HHG to the upper echelons of the direct sales industry.</p>\r\n<p>Over his 17 year career in direct sales, Ted has hit the top positions in every company he has been involved in. He has built organizations of over 55,000 distributors with over $10 million in yearly group revenue. As a member of the elite club of documented direct sales millionaires, his passion for helping people is what drove him to start Healthy Habits.</p>\r\n<p>Ted had a mission to start a company that always thought of the distributors and customers first. He was very diligent in selecting his executive staff, making sure they all shared the same vision, passion and integrity. Ted states &ldquo;our goal is to change the lives of people around the world on our way of becoming a billion dollar company.</p>\r\n<p>&nbsp;</p>\r\n<h3><span>Kevin Michael Tornai</span>&nbsp;&ndash; Executive Vice President</h3>\r\n<p>Kevin has been in the direct sales industry for over 10 years and brings an immense amount of business and leadership experience to HHG. Prior to his direct sales career Kevin &ldquo;Sarge&rdquo; &nbsp;had served nearly 5 years in the United States Marine Corps. After receiving an honorable discharge in 2003 he carried forward the same discipline and leadership traits into the civilian sector and has achieved high levels of success in his sales and marketing career. Today he has found himself very passionate and purpose driven to help distributors break barriers, face fears and to simply dream again.</p>\r\n<p>&nbsp;</p>\r\n<h3><span>Josh D Nelson</span>&nbsp;&ndash; Co-Owner and Vice President of Sales</h3>\r\n<p>Josh Nelson has been involved in Direct Sales for over 11 years and has massive success building leaders in many countries around the world with tens of thousands of team members. Josh was the #1 income earner in his last company for 5 years straight and practices what he preaches. He has hit the top ranks in multiple companies and has built a proven system that is now a part of HHG. He has experience helping companies build compensation plans that always put the reps first. He brings international market experience as well as well as being a mentor to many top income earners around the world. His passion is people and lives to see others succeed and achieve their dreams and goals through this industry as he has, along with his wife and 2 children. Josh Nelson is a true believer that the biggest assets you have is your integrity, morals, and character and is never willing to compromise them for anything. He\'s been through it all in this industry and is passionate about sharing his experiences with the masses to help them reach financial freedom.&nbsp;<br /><br />Josh Nelson said &ldquo;I may be a Co-Owner at HHG, but I am a rep at heart. I am here to serve the HHG business partners and see millions of lives enhanced through this amazing company!&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<h3><span>Kambree Nelson</span>&nbsp;&ndash; Co-Owner and Vice President of Field Relations</h3>\r\n<p>Kambree Nelson brings 7 dedicated years in the direct selling industry to HHG. As a #1 Income Earner in her previous company and the marketing director on the corporate side of another company, Kambree Nelson brings a tremendous amount of experience to HHG from all facets of the industry. She has built teams of 10&rsquo;s of thousands of reps in many countries as well as built successful training systems that has been responsible for 10&rsquo;s of millions of dollars in revenue. Kambree Nelson is the definition of a servant leader and is known to many for always putting others needs before her own. She has traveled the world speaking, mentoring, and developing top earners that have achieved massive success. Kambree Nelsons passion in life is people. She thrives on the success of others and knows that her God given gift is servant leadership. Kambree Nelson has very high standards when it comes to integrity and ethics. Kambree has been featured on NBC news for her success in the industry and has been an inspiration to many around the world. Kambree is an example of what this industry can provide. Being a single mother of 2, despite the odds against her, fought through the ups and downs and has become one of the most respected women in this industry. Kambree Nelson feels that as a co-owner at HHG she can use the full potential of her experience and gifts to help millions of people achieve whatever level of success they want.&nbsp;<br /><br />Kambree Nelson states, &ldquo; No matter what obstacles in life I face, and no matter what the enemy tries to shoot at me. I am prepared by staying armored up. I only armor up in the front, because when I go into battle, I go in face first. Nothing can attack me from the behind.&rdquo; ~ I am a Warrior Chic.</p>\r\n<p>&nbsp;</p>\r\n<h3><span>Sean Sladek</span>&nbsp;&ndash; Vice President of Operations</h3>\r\n<p>Sean has been involved in the Network Marketing industry for over 22 years. Sean started his career with Amway where he spent 9 years with the company. He worked as a senior buyer for and was responsible for approximately 65% of the total volume produced by the Amway catalogue. Sean has worked in product development, marketing and sales capacities, supplying products to network marketing for the last 13 years. Sean\'s expertise is identifying product trends in the marketplace, selecting companies to manufacture those products and taking the finished product to the market. His major focus has been consumable products in the health &amp; wellness categories including supplements, weight loss products, sports nutrition products and cosmetics. He also specializes in private label appliances.</p>\r\n</div>','2014-09-04 22:55:37','2014-09-04 22:58:42',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Horario de llamadas','single_page',NULL,NULL,'horario-de-llamadas',NULL,'<div class=\"main-banner-holder\"><img title=\"Todos los productos\" src=\"{{media url=\"wysiwyg/paginas/callschedule-header.jpg\"}}\" alt=\"Todos los productos\" /></div>\r\n<div class=\"container separator-shadow\">\r\n<div class=\"content\">\r\n<h1>Llamada Calendarizada</h1>\r\n<div class=\"entry-content\">\r\n<h2>Todos los Lunes y Jueves a las 8PM:</h2>\r\n<h3><span>805-399-1000</span>&nbsp;&ndash; Codigo de acceso:&nbsp;<span>213570#</span></h3>\r\n<h3>Te esperamos</h3>\r\n<div>&nbsp;</div>\r\n</div>\r\n&nbsp;</div>\r\n</div>','2014-09-04 23:14:14','2014-09-08 19:56:59',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(15,'FAQ','single_page',NULL,NULL,'faq',NULL,'<div class=\"main-banner-holder\"><img title=\"Todos los productos\" src=\"{{media url=\"wysiwyg/paginas/faqs-header.jpg\"}}\" alt=\"Todos los productos\" /></div>\r\n<div class=\"container separator-shadow\">\r\n<div class=\"content\">\r\n<h1><strong>FAQs</strong></h1>\r\n<div class=\"entry-content\">\r\n<h3>Q. What is Ginseng??</h3>\r\n<p><strong>A.</strong>&nbsp;For years, the Chinese have used Ginseng as an energy tonic. Today, the western world is exploring its benefits in treating stress and levels of mental lucidity. Russian research has found Ginseng stimulates physical and mental activity in tired and weak individuals. It was also found to help with balance.</p>\r\n<h3>Q. What is Reishi?</h3>\r\n<p><strong>A.</strong>&nbsp;Reishi in Ancient Eastern Medicine was known as the \"Mushroom of Immortality\" and the \"Medicine of Kings.\" It boosts your body\'s immune system. Traditional Eastern Medicine explains Reishi\'s wide range of medicinal applications. According to Eastern though, the body needs to defend itself against threats to its \"equilibrium.\" These threats can be physical, such as viruses and bacteria that cause infection; emotional, such as stress that causes anxiety; or energetic, in that they reduce alertness. Whatever the threat, Reishi helps the body maintain its defense against its equilibrium, helping the body to maintain balance, which is why an equilibrium-enhancing remedy such as Reishi can help so many diverse ailments.</p>\r\n<h3>Q. What is Chai?</h3>\r\n<p><strong>A.</strong>&nbsp;Chai is a spiced milk tea that has become increasingly popular throughout the word. Chai produces a warming, soothing effects, acts as a natural digestive aid and gives one a wonderful sense of well being.</p>\r\n<h3>Q. Are Healthy Habits products Gluten free?</h3>\r\n<p><strong>A.</strong>&nbsp;Absolutely</p>\r\n<h3>Q. Where are Healthy Habits products manufactured?</h3>\r\n<p><strong>A.</strong>&nbsp;Our products are blended in Malaysia with quality ingredients from different parts of the world. Our state of the art manufacturing facilities are ISO certified and have excellent standards of quality control. Our product formulation is carefully processed to ensure our promise of excellence.</p>\r\n<h3>Q. How can I buy Healthy Habits products?</h3>\r\n<p><strong>A.</strong>&nbsp;Healthy Habits products can be obtained through a Healthy Habits distributor. Please email your request to info@HealthyHabitsGlobal.com</p>\r\n<h3>Q. How can I find a Healthy Habits Distributor in my area?</h3>\r\n<p><strong>A.</strong>&nbsp;We are more than happy to assist you in locating the closest Healthy Habits representative in your area. Please email your request to support@HealthyHabitsGlobal.com</p>\r\n<h3>Q. How do I become a Healthy Habits Distributor?</h3>\r\n<p><strong>A.</strong>&nbsp;You must enroll at the Healthy Habits Independent Distributor\'s web site or if you do not have a sponsor we will be more than happy to assist you. Please email us at info@HealthyHabitsGlobal.com</p>\r\n<h3>Q. How do I become a Healthy Habits Founding Distributor?</h3>\r\n<p><strong>A.</strong>&nbsp;Please refer to the Founder\'s Opportunity at www.HealthyHabitsGlobal.com</p>\r\n<h3>Q. How do I contact someone with questions about the company?</h3>\r\n<p><strong>A.</strong>&nbsp;For questions about Healthy Habits Global, email us at info@HealthyHabitsGlobal.com</p>\r\n<h3>Q. What are Healthy Habits hours of operation?</h3>\r\n<p><strong>A.</strong>&nbsp;Our experienced, friendly staff is ready to assist you from 9:00 AM to 4:00 PM PST (Pacific Standard Time) in the USA. For other countries or regions, please email us at support@HealthyHabitsGlobal.com</p>\r\n<h3>Q. Can I enroll as a Corporation or Partnership?</h3>\r\n<p><strong>A.</strong>&nbsp;Yes</p>\r\n</div>\r\n&nbsp;</div>\r\n</div>','2014-09-04 23:37:33','2014-09-10 17:23:57',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Testimoniales','single_page',NULL,NULL,'testimoniales',NULL,'<div class=\"main-banner-holder\"><img title=\"Todos los productos\" src=\"{{media url=\"wysiwyg/paginas/testimonials-header.jpg\"}}\" alt=\"Todos los productos\" /></div>\r\n<div class=\"container separator-shadow\">\r\n<div class=\"content\">\r\n<h1><strong>Testimonials</strong></h1>\r\n<div class=\"entry-content\">\r\n<div class=\"slider-item\">\r\n<div class=\"quote-text\">\r\n<p>I\'m a stay at home mom and wife. I have beautiful children whom I home-school and a baby who I nurse. For me Finding an honest business that I could do from home was critical when looking for the right opportunity. I have done every type of business opportunity, everything from technology, to health drinks and weight loss. All these resulted in medium success where I was able to create moderate 4 figures a month residual, but never the 5 figures a month and beyond which I dreamed of. I never did feel as if I hit the Jackpot though. Curiously enough I never cared to have a coffee business because the idea just seemed not viable, nor sexy or unique. It was too simple, too plain. Then I learned about Healthy Habits Global. The compensation part appeared very lucrative and the leadership seemed very ethical and professional.</p>\r\n<p>I reluctantly tried the products and fell in love with them. That\'s when it hit me like a ton of rocks! This business is so easy because people just love coffee and this product truly is delicious. I do not have to convince or sell people on the idea to buy from me. I simply let them sample my product and let them decide whether to buy or not. Now I am a proud Healthy Habits Global distributor and I am seeing AMAZING financial results. In my first month I was able to crush out the first rank and get my prosperity commission. Never in my 14 year experience with direct selling and the Networking arena have I seen this much money compared to the amount of work I put in. I\'m making money from home, I\'m helping people to have a healthier coffee habit and I can do this all from the comfort of my home never leaving my babies aside just to make money. I am gratefully to Healthy Habits for giving me this golden opportunity.\"</p>\r\n</div>\r\n<div class=\"quote-author\"><span>PROUD HEALTHY HABITS PROMOTER,&nbsp;<span>S. SHAMUS</span></span></div>\r\n</div>\r\n<hr />\r\n<div class=\"slider-item\">\r\n<div class=\"quote-text\">\r\n<p>Finding HHG is like getting into the Super Bowl and winning. After 20 years in network marketing this is the one! What a great opportunity, a professional management team leading us, and a fantastic product that millions of people can relate to and use. Healthy Enriched coffee not only tastes great, it really will improve your health as well. My advise is to get in, and never quit on this one because you can finally reach your dream income here at HHG.\"</p>\r\n</div>\r\n<div class=\"quote-author\"><span>R. VIGARD</span></div>\r\n</div>\r\n<hr />\r\n<div class=\"slider-item\">\r\n<div class=\"quote-text\">\r\n<p>I started drinking the enriched coffee in June 2013. I have been committed to it every day. I have noticed incredible energy and stamina. My mental focus and clarity has improved as well. I also have been able to sleep through the night, which was very unusual for me. Regular coffee always made my stomach queasy and also made me feel very jittery. Another thing that was very obvious was how fast abrasions ans sores were healing. I will never be without my healthy enriched coffee. After research on the product, I can only imagine the benefits internally. Thank You HHG\"</p>\r\n</div>\r\n<div class=\"quote-author\"><span>J. MUSICK</span></div>\r\n</div>\r\n<hr />\r\n<div class=\"slider-item\">\r\n<div class=\"quote-text\">\r\n<p>I love Healthy Habits Coffee!! Before Healthy Habits I would consume 32 oz of strong coffee before noon. I\'ve cut my coffee consumption in half now that I\'m enjoying Healthy Habits beverages. They leave me feeling satisfied and full of energy without the caffeine jitters. I love the fact that something so good for you can be so enjoyable!\"</p>\r\n</div>\r\n<div class=\"quote-author\"><span>T. ZECHA</span></div>\r\n</div>\r\n<hr />\r\n<div class=\"slider-item\">\r\n<div class=\"quote-text\">\r\n<p>I am a busy mom who loves the convenience of the pour and go. My kids love the Chai Tea for a warm drink on the way to school in the morning. Also, I am extremely careful and selective with my caffeine ingestion as I can easily become jittery and uncomfortable. Yet, needing a pick me up in the afternoon to get through the day has been nice with the Healthy Habits Coffee as I have received energetic benefits without any caffeine side effects.\"</p>\r\n</div>\r\n<div class=\"quote-author\"><span>KATIE FROM VA</span></div>\r\n</div>\r\n</div>\r\n&nbsp;</div>\r\n</div>','2014-09-04 23:46:08','2014-09-08 19:57:46',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(17,'Unirse','single_page',NULL,NULL,'unirse',NULL,'<div class=\"container\">\r\n<div class=\"content\">\r\n<h2>Getting started with Healthy Habits Global is easy.</h2>\r\n<h3>Sponsor Code</h3>\r\n<p>In order to take advantage of the products and/or opportunity, you must be invited by a member who will provide you with a sponsor code. Please enter your sponsor code below to continue, if you do not have a sponsor code, we recommend contacting the individual that shared Healthy Habits Global with you to ask them for their username/sponsor code.</p>\r\n<div>&nbsp;</div>\r\n<p><a class=\"button_link btn_orange\" style=\"outline: none; opacity: 1;\" href=\"#\"><span>UNIRSE</span></a></p>\r\n</div>\r\n</div>','2014-09-05 00:00:52','2014-09-08 19:57:57',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(18,'Contact Us','one_column',NULL,NULL,'contact-us',NULL,'<p>{{block type=\'core/template\' name=\'contactForm\' template=\'contacts/form.phtml\' }}</p>','2014-09-09 22:42:42','2014-09-10 00:12:14',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(19,'Privacy Policy','one_column',NULL,NULL,'privacy-policy',NULL,'\r\n<div class=\"container separator-shadow clearfix\">\r\n<div class=\"content\">asda</div>\r\n</div>','2014-09-09 22:43:35','2014-09-09 22:43:35',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Terminos y Condiciones','one_column',NULL,NULL,'terms-and-conditions',NULL,'<p>dd</p>','2014-09-09 22:44:17','2014-09-09 22:44:28',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(21,'Resources','one_column',NULL,NULL,'resources',NULL,'<p>test</p>','2014-09-09 22:45:08','2014-09-09 22:45:08',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(22,'Income Disclaimer','one_column',NULL,NULL,'income-disclaimer',NULL,'<p>test</p>','2014-09-09 22:45:35','2014-09-09 22:45:35',1,0,NULL,NULL,NULL,NULL,NULL,NULL);
